svg.script:
    // 
	var tmp = {};
    window.addEventListener("DOMContentLoaded", () => {
      console.log("hdvh");


						const homeAni = ()=>{
						if(window.location.pathname.includes("pages")){
						console.log("Not home page.");
						}else{
						console.log("Run Animation...");
						//const momSVG = document.querySelectorAll("#svg1")[0].getSVGDocument(); 
						//const momSVG = this;
						document.querySelectorAll("#TZ")[0].setAttribute("fill","#055106");
						const doc = document.querySelectorAll("path");
						tmp["counterT"] = 0;
						const inTerv = window.setInterval(()=>{
						if(tmp.counterT>60){
						tmp.counterT = 0;
						resetSVGit(doc);
						}else{
						var r = doc[tmp.counterT]; // suppose our image contains a <rect>
						loadSVGit(r);
						tmp.counterT++;
						}

						},1692)
						}

						}

						const loadSVGit =(r)=> {
						r.setAttribute("fill", "#a2a9ad");
						r.setAttribute("stroke", "#fff");
						r.classList.remove("st0");
						//r2.setAttribute("fill", "#fff");
						}


						const resetSVGit =(d)=> {
						d.forEach(r=>{
						r.setAttribute("fill", "#fff");
						r.setAttribute("stroke", "#fff");
						r.classList.add("st0");
						})
						}


		homeAni();
    });
    //
